function GetTodos({ todos, setTodos }) {
  return (
    <>
      {todos.map((todo) => (
        <div key={todo.id}>
          <span
            style={{
              textDecoration: todo.completed ? "line-through" : "none",
            }}
            onClick={() => handleComplete(todo.id)}
          >
            {todo.todo}
          </span>
          <span onClick={() => handleDelete(todo.id)}> X</span>
        </div>
      ))}
    </>
  );
}

export default GetTodos;
